import React from "react";

export default function Home() {
  return (
    <div class=" flex h-16 w-16">
      <img
        class="mx-4 rounded-full border border-gray-100 shadow-s"
        src="https://randomuser.me/api/portraits/lego/5.jpg"
        alt="user image"
      />
      <div class="flex justify-between items-center">
        <a href="" class="no-underline py-1">
          <h1 class="font-bold text-lg text-orange-500 tracking-widest">
            vahan.m
          </h1>
        </a>
      </div>
    </div>
  );
}
